import React from 'react';


function ListPage(){
    const ListUp = input.map(v=>(
        <InputItem
            key={v._id}
            happy={v.happy}
            angry={v.angry}
            sad={v.sad}
            joy={v.joy}
            title={v.title}
            body={v.body}
            onDeleteClick={()=>onDeleteClick(v)}
        />
    ));
    return(
        <div>
            <h1>지난 기록을 살펴보세요.</h1>
            {ListUp}
        </div>
    );
}

export default ListPage;
